  addToList() async {
    for(int i=0;i < 500;i++) {

      final query = details[i][8].toString();

      var addresses = await Geocoder.local.findAddressesFromQuery(query);
      var first = addresses.first;
      print(i);
      FloatingActionButton(onPressed: null,child: Text("$i /500",textAlign: TextAlign.right,),);


      setState(() {
        _marker.add(new Marker(markerId: MarkerId(query),
            position: new LatLng(first.coordinates.latitude,first.coordinates.longitude ),
            icon: BitmapDescriptor.defaultMarkerWithHue(BitmapDescriptor.hueMagenta),
          infoWindow: InfoWindow(title: query),
          
        ),

        );



      });

    }

  }





