      body: Column(
        children: <Widget>[
          Container(
            height: MediaQuery.of(context).size.height-80.0,
            width: double.infinity ,
            child:
            GoogleMap(

              onMapCreated: _onMapCreated,

              initialCameraPosition: CameraPosition(
                  target: LatLng(12.9716, 77.5946),zoom: 10.0),
              markers: _marker,


